import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Hero from './Hero';
import Projects from './Projects';
import ProjectDetail from './ProjectDetail'; // Import the ProjectDetail component
import Contact from './Contact';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope, faLinkedinIn, faGithub, faFile } from '@fortawesome/free-solid-svg-icons';

function App() {
  return (
    <Router>
      <Hero />
      <Routes>
        <Route path="projects" element={<Projects />}>
          <Route path=":id" element={<ProjectDetail />} /> {/* Nested route for individual project details */}
        </Route>
        <Route path="contact" element={<Contact />} />
      </Routes>
      <div className="fixed-icons">
        <a href="mailto:jgreen142@my.gcu.edu">
          <FontAwesomeIcon icon={faEnvelope} />
        </a>
        <a href="https://www.linkedin.com/in/james-green-a21170261" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faLinkedinIn} />
        </a>
        <a href="https://github.com/JamesGreen1210" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faGithub} />
        </a>
        <a href="/James_Green_Resume.pdf" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faFile} />
        </a>
      </div>
    </Router>
  );
}

export default App;
